const viewerStyle = {
  '::selection': {
    'background-color': '#d4e9ff',
  },

  img: {
    '-webkit-touch-callout': 'none',
    '-webkit-user-select': 'none',
    '-khtml-user-select': 'none',
    '-moz-user-select': 'none',
    '-ms-user-select': 'none',
    'user-select': 'none',
  },
  div:{
    'font-family': 'Fira code'
  }
};

export default viewerStyle;
